def d(i):#拼音
    r=""
    for y in list(i):
        try:
            r+=dictionary[y]+" "
        except:
            r+=y+" "
    return r

def dd(i):#字母
    r=""
    for y in list(i):
        try:
            y=dictionary[y]
            y=y.replace('ā','a').replace('á','a').replace('ǎ','a').replace('à','a')
            y=y.replace('ō','o').replace('ó','o').replace('ǒ','o').replace('ò','o')
            y=y.replace('ē','e').replace('é','e').replace('ě','e').replace('è','e')
            y=y.replace('ī','i').replace('í','i').replace('ǐ','i').replace('ì','i')
            y=y.replace('ū','u').replace('ú','u').replace('ǔ','u').replace('ù','u')
            r+=y.replace('ǖ','v').replace('ǘ','v').replace('ǚ','v').replace('ǜ','v').replace('ü','v')+" "
        except:
            r+=y+" "
    return r

def dn(i):#数学
    i=dd(i)
    i=i.replace('a','2').replace('b','2').replace('c','2').replace('d','3').replace('e','3').replace('f','3').replace('g','4').replace('h','4').replace('i','4').replace('j','5').replace('k','5').replace('l','5').replace('m','6').replace('n','6').replace('o','6').replace('p','7').replace('q','7').replace('r','7').replace('s','7').replace('t','8').replace('u','8').replace('v','8').replace('w','9').replace('x','9').replace('y','9').replace('z','9')
    return i

